import Dump from "../../components/Dump";

export default function zHYLjCoV3d() {
  return (
    <div>
      <Dump id="polymer">
        {new Array(19).fill(0).map((url, index) => (
          <img
            className="workComponent"
            src={`/zHYLjCoV3d--${index}.gif`}
            key={index}
          />
        ))}
      </Dump>
      <style jsx>{`
        .workComponent {
          max-height: 400px;
          max-width: 500px;
        }
      `}</style>
    </div>
  );
}
